import { FETCH_USER } from "../actions/types";

const INITIAL_STATE = {
    isLoggedIn: null,
    googleId: null
}

export default function(state = INITIAL_STATE, action) {
    switch(action.type) {
        case FETCH_USER:
            console.log(action.payload);
            return {...state, googleId: action.payload, isLoggedIn: true } || false;
        default:
            return state;
    }
}
